var concordarDiscordar = {
    $curtir:{
        obj:'',
        icone:'',
        texto:''
    },
    $descurtir:{
        obj:'',
        icone:'',
        texto:''
    },

    init: function(curtir,descurtir) {
        this.$curtir.obj         = $(curtir);
        this.$descurtir.obj      = $(descurtir);

        this.$curtir.icone       = this.$curtir.obj.find('.fa');
        this.$curtir.texto       = this.$curtir.obj.find('span');
        this.$descurtir.icone    = this.$descurtir.obj.find('.fa');
        this.$descurtir.texto    = this.$descurtir.obj.find('span');

        this.bind();
    },
    bind: function() {
        var self = this;
        self.$curtir.obj.bind({
            click:function (e) {
                $this = $(this);
                if ($this.hasClass('precisa-login')) {
                    self.facaLogin('concordar',$this.data('cod'));
                } else {
                    self.$curtir.icone.attr('class','fa fa-spin fa-spinner');
                    self.send($this.data('cod'),1);
                }
                e.preventDefault();
            }
        });
        self.$descurtir.obj.bind({
            click:function (e) {
                $this = $(this);
                if ($this.hasClass('precisa-login')) {
                    self.facaLogin('discordar',$this.data('cod'));
                } else {
                    self.$descurtir.icone.attr('class','fa fa-spin fa-spinner');
                    self.send($this.data('cod'),2);
                }
                e.preventDefault();
            }
        });
    },

    unbind: function () {
        var self = this;
        self.$curtir.obj.unbind().bind({
            click:function(e){
                e.preventDefault();
            }
        });
        self.$descurtir.obj.unbind().bind({
            click:function(e){
                e.preventDefault();
            }
        });
    },

    send: function (cod,type) {
        var self = this;
        $.ajax({
            url: window.defaultUrl + '/ouvidoria/'+ ((type==1)?'concordar':'discordar'),
            cache:false,
            method :'POST',
            data: {codigo:cod},
            dataType:'json',
            beforeSend:function() {
                self.unbind();
            },
            error: function () {
                alert('Não foi possível concluir sua ação.');
            },
            success:function(data){
                self.$curtir.texto.html(data.concordar);
                self.$descurtir.texto.html(data.discordar);
                if (type==1) {
                    self.$descurtir.obj.removeClass('active');
                    if (self.$curtir.obj.hasClass('active')) {
                        self.$curtir.obj.removeClass('active');
                    } else {
                        self.$curtir.obj.addClass('active');
                    }
                } else {
                    self.$curtir.obj.removeClass('active');
                    if (self.$descurtir.obj.hasClass('active')) {
                        self.$descurtir.obj.removeClass('active');
                    } else {
                        self.$descurtir.obj.addClass('active');
                    }
                }
            },
            complete: function (data) {

                self.$curtir.icone.attr('class','fa fa-thumbs-up');
                self.$descurtir.icone.attr('class','fa fa-thumbs-down');
                self.bind();
            }
        });
    },

    facaLogin:function (action,id) {
        var $wrapper = $('#login-wrapper-fancy'),
            $body = $(document.body),
            fnToggleClassBody;

        fnToggleClassBody = function () {
            $body.toggleClass('modal-login');
        };

        fnToggleClassBody();
        
        $wrapper.removeClass('hide').bind({
            click:function(e){
                $wrapper.unbind().addClass('hide');
                fnToggleClassBody();
                e.preventDefault();
            }
        });
        $wrapper.find('*').bind({
            click:function(e){
                e.stopPropagation();
            }
        });
        if ($wrapper.find('close').length == 0 ) {
            $close = $('<span class="close"><i class="fa fa-close"></i></span>');
            $close.bind({
                click:function(e) {
                    $wrapper.unbind().addClass('hide');
                    fnToggleClassBody();
                    e.preventDefault();
                }
            });
            $wrapper.find('.wrapper-login-ouvidoria').append($close);
        }
        $wrapper.find('[name="action"]').val(action);
        $wrapper.find('[name="id_registro"]').val(id);
    }

};
