(function ($) {
    var _rel = [];
    $.fn.openElement = function () {
        return this.each(function () {
            var $this = $(this);
            var $obj = $($this.attr('href'));
            $this.bind({
                click: function (e) {
                    if ($obj.hasClass('hide')) {
                        $obj.css('display', 'none').removeClass('hide');
                    }
                    var dataRel = $this.data('rel');
                    if (dataRel) {
                        $obj.data('rel', dataRel)
                        $.each(_rel, function (i, el) {
                            //se nao foi deletado
                            if (typeof el != 'undefined') {
                                if (
                                        el.data('rel') == dataRel &&
                                        el.css('display') == 'block' &&
                                        el != $obj
                                        ) {
                                    //se tiver o mesmo rel do obj atual, estiver exibindo e nao for o obj atual feche e delete
                                    el.stop().slideToggle();
                                    toggleVideo(el, 'pauseVideo');
                                    delete _rel[i];
                                } else if (el == $obj) {
                                    //se for o objto em questão apenas feche
                                    delete _rel[i];
                                }
                            }
                        });
                    }
                    //fazer o contrario do display atual
                    var func = ($obj.css('display') == 'block') ? 'pauseVideo' : 'playVideo';
                    toggleVideo($obj, func);

                    $obj.stop().slideToggle();

                    _rel.push($obj);
                    e.preventDefault ? e.preventDefault() : e.returnValue = false;
                }
            });
            return this;
        });
    }

    $.fn.duplicateElement = function () {
        return this.each(function () {
            var $this = $(this);
            var $obj = $($this.attr('href'));
            $this.bind({
                click: function (e) {
                    $obj.clone().insertAfter($this.attr('href'));
                    e.preventDefault ? e.preventDefault() : e.returnValue = false;
                }
            });
            return this;
        });
    }
}(jQuery));

var ObservadorFonteBody = {
    $el: false,

    inicializar: function() {
        var self = this;

        $('.nav-access-aumentar').click(function(e) {
            self.aumentar();

            e.preventDefault ? e.preventDefault() : e.returnValue = false;
        });

        $('.nav-access-diminuir').click(function(e) {
            self.diminuir();

            e.preventDefault ? e.preventDefault() : e.returnValue = false;
        });

        $('.nav-access-fonte-original').click(function(e) {
            self.retornarAoTamanhoOriginal();

            e.preventDefault ? e.preventDefault() : e.returnValue = false;
        });
    },
    aumentar: function() {
        var self = this;

        if (self.$el === false) {
            self.$el = $('*');
        };

        self.$el.each(function(index, el) {
            var $el = $(el);
            var fonteElemento = parseInt($el.css('font-size'));

            self.setDataTamanhoOriginal(fonteElemento, $el);

            $el.css('font-size', fonteElemento + 2);
        });
    },
    diminuir: function() {
        var self = this;

        if (self.$el === false) {
            self.$el = $('*');
        };

        self.$el.each(function(index, el) {
            var $el = $(el);
            var fonteElemento = parseInt($el.css('font-size'));

            self.setDataTamanhoOriginal(fonteElemento, $el);

            $el.css('font-size', fonteElemento - 2);
        });
    },
    setDataTamanhoOriginal: function(fonteOriginal, $el) {
        if ($el.data('fonte-original') === undefined) {
            $el.data('fonte-original', fonteOriginal);
        };
    },
    retornarAoTamanhoOriginal: function() {
        var self = this;

        if (self.$el === false) {
            self.$el = $('*');
        };

        self.$el.each(function(index, el) {
            var $el = $(el);
            var fonteElemento = $el.data('fonte-original');

            $el.css('font-size', fonteElemento);
        });
    }
};

