function documentoTipoSubtipo() {
    var $comboDocumentoTipo = $('#DocumentoIndexForm #DocumentoTipo');
    if ($comboDocumentoTipo.length > 0) {
        $comboDocumentoTipo.change(function (e, DocumentoSubtipoId) {
            $documentoTipoSubtipo = $('#DocumentoIndexForm #DocumentoSubtipo');

            $documentoTipoSubtipo.attr('disabled', true);
            $documentoTipoSubtipo.empty();
            $documentoTipoSubtipo.append('<option value="">Todos</option>');

            if ($(this).val() != '') {
                $.ajax({
                    url: window.defaultUrl + 'documentos/aTipoSubtipos/' + $(this).val(),
                    dataType: 'json',
                    success: function (data) {

                        if (data.error == undefined) {
                            var options = '';
                            for (var o in data) {
                                options += '<option value="' + o + '">' + data[o] + '</option>';
                            }

                            $documentoTipoSubtipo.append(options);
                            $documentoTipoSubtipo.attr('disabled', false);

                            if (DocumentoSubtipoId && DocumentoSubtipoId != '' && DocumentoSubtipoId.split(',').length === 1) {
                                $documentoTipoSubtipo.val(DocumentoSubtipoId);
                            }

                        } else {
                            $documentoTipoSubtipo.attr('disabled', true);
                        }
                    }
                });
            }
        });
    }
}

function getEventosAgendaAjax(year, month) {
    if (year == undefined) {
        year = new Date().getFullYear();
    }

    if (month == undefined) {
        month = new Date().getMonth() + 1;
    }

    var events = null;
    var url = window.defaultUrl + 'agendas/aEventosJson/ano:' + year + '/mes:' + month;

    if ($('#AgendaVereadorId').length > 0) {
        url += '/vereador:' + $('#AgendaVereadorId').val();
    }

    $.ajax({
        'async': false,
        'global': false,
        'url': url,
        'dataType': "json",
        success: function (data) {
            events = $.map(data, function (value, index) {
                return data[index];
            });
        }
    });

    return events;
}

